import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on "Your Profile" link using text selector
    await page.waitForSelector('text=Your Profile', { timeout: 5000 });
    await page.click('text=Your Profile');

    // Wait for profile page to load and take screenshot
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const profileData = await page.evaluate(() => {
      const profileInfo = document.querySelector('.profile-info');
      const stats = document.querySelectorAll('.stat');

      return {
        fullName: profileInfo?.querySelector('h2')?.innerText || 'Not found',
        username: profileInfo?.querySelector('.username')?.innerText || 'Not found',
        bio: profileInfo?.querySelector('.bio')?.innerText || 'Not found',
        ordersCount: stats[0]?.querySelector('.stat-number')?.innerText || 'Not found',
        reviewsCount: stats[1]?.querySelector('.stat-number')?.innerText || 'Not found',
        sellerRating: stats[2]?.querySelector('.stat-number')?.innerText || 'Not found'
      };
    });

    // Take final screenshot with profile data
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_data.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_data.png'));

    return {
      success: true,
      action: "Harvested user profile information successfully",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
